import tick from '../../img/green-tick.png'
import close from '../../img/close.svg'
import './TodoList.css'

const TodoBtn = (props) => {
    return (
        <div onClick={() => props.onclick(props.todo.id, props.todo.label)} id={props.todo.complete ? 'unhidden' : 'hidden'}>
            <button className="todoBlock__solve">
                <img src={props.img} width={"30px"} alt=""/>
            </button>
        </div>
    )
}

const TodoList = (props) => {

    return (
        <div  className="task-list__block">
            <div className={props.todo.complete ? 'completed' : 'uncompleted'}
                 style={{
                     wordBreak: 'break-word',
                     width: '280px',
                     textAlign: 'start',
                     fontFamily: 'Courier, serif',

                 }}>
                <span onClick={() => props.handle.handleTodo(props.todo.id)}  style={{cursor: "pointer"}}>{ props.todo.label}</span>
            </div>

            <div className="task-list__todoBlock">
                <TodoBtn img={tick} todo={props.todo} onclick={props.handle.handleSolve} />
                {/*<div onClick={() => props.handle.handleSolve(props.todo.id, props.todo.label)} id={props.todo.complete ? 'unhidden' : 'hidden'}>*/}
                {/*    <button className="todoBlock__solve">*/}
                {/*        <img src={tick} width={"30px"} alt=""/>*/}
                {/*    </button>*/}
                {/*</div>*/}

                <div onClick={() => props.handle.handleClose(props.todo.id)}>
                    <button className="todoBlock__close">
                        <img src={close} alt=""/>
                    </button>
                </div>

            </div>
        </div>
    )
}


export default TodoList
